import React from 'react';
import '../assets/styles/App.css';
import { Player } from '@lottiefiles/react-lottie-player';
import atom from '../assets/imgs/atom.json';

const Home = () => {
  return (
    <div>
      <h1>Hello Home</h1>
      <Player
        autoplay
        loop
        src={atom}
        style={{ height: '200px', width: '200px' }}
      />
    </div>
  );
};

export default Home;
